import React from 'react';
import SpotifyWebApi from 'spotify-web-api-node';
import useAuth from './useAuth';
import TopTracks from './pages/TopTracks';
import TopArtists from './pages/TopArtists';
import Dashboard from './Dashboard';

import { useEffect } from 'react';
import { Route, Routes, Link } from 'react-router-dom';

import './dashboardNavbar.css';

export default function DashboardNavbar({ accessToken }) {

    let newProps = {
        code: "",
        accessToken: accessToken
    };

    return (
        <>
            <div>
                <Link to="/" >Go Home</Link>
                <Link to="/top-tracks" >See Your Top Tracks</Link>
                <Link to="/top-artists" >See Your Top Artists</Link>
            </div>
            <Routes>
                <Route path="/" element={<Dashboard props={newProps} />} ></Route>
                <Route path="/top-tracks" element={<TopTracks accessToken={accessToken} />} ></Route>
                <Route path="/top-artists" element={<TopArtists accessToken={accessToken} />} ></Route>
            </Routes>
        </>
    )
}
